import "./App.css"
import { useEffect, useState } from "react"

import { Tickets } from "./models/types"
import { handleDashboardData } from "./store/actions/shared"

import Dashboard from "./components/Dashboard"
import CircularProgress from "@material-ui/core/CircularProgress"
import { connect } from "react-redux"

function App({ dispatch }) {
  const [data, setData] = useState({} as Tickets)

  useEffect(() => {
    dispatch(handleDashboardData())
  }, [])

  console.log(data)
  return (
    <div>
      <Dashboard tickets={data as Tickets} /> <CircularProgress />
    </div>
  )
}

export default connect()(App)
